css:
.sass-autocompile .loading-spinner-tiny {
  margin-left: 10px;
}
.sass-autocompile .right-top-options .btn-close {
  height: 100%;
}
.sass-autocompile .clickable {
  cursor: pointer;
}
.sass-autocompile .clickable:hover {
  background-color: #1d1e21;
}
.sass-autocompile .open-node-sass-output {
  display: inline-block;
  cursor: pointer;
  color: #fff;
}
.sass-autocompile .open-node-sass-output:hover {
  color: #5293d8;
}
.sass-autocompile .open-node-sass-output::before {
  content: "\2014";
  display: inline-block;
  padding: 0 10px;
  cursor: default;
  color: rgba(170, 170, 170, 0.3);
}
.sass-autocompile .panel-body {
  padding: 10px 0;
}
.sass-autocompile .panel-body p {
  margin: 0;
  padding: 4px 10px;
}
.sass-autocompile .panel-body .success-text-wrapper .success-details {
  color: #888;
}
.sass-autocompile .panel-body .success-text-wrapper .success-details .success-output-style {
  padding: 0 0 0 21px;
}
.sass-autocompile .panel-body .success-text-wrapper .success-details .success-duration {
  padding: 0 0 0 12px;
}
.sass-autocompile .panel-body .success-text-wrapper .success-details .success-file-size {
  padding: 0 0 0 12px;
}
.sass-autocompile .panel-body .success-text-wrapper .success-details .value {
  font-weight: bold;
}
.sass-autocompile .panel-body .error-text {
  padding: 0 0 0 7px;
}
.sass-autocompile .panel-body .error-file-wrapper {
  padding-left: 21px;
}
.sass-autocompile .panel-body .error-file {
  padding: 0 7px;
}
.sass-autocompile .panel-body .error-line::before {
  content: '(';
}
.sass-autocompile .panel-body .error-line::after {
  content: ', ';
}
.sass-autocompile .panel-body .error-column::after {
  content: ')';
}
